Desc:
Erica and her husband are a very naughty couple. They love to be with each other, but even more than that, they love to invite young girls into their bed!

While on holiday in Spain they meet the insatiable Sunshine, they both love her. Erica can not wait to share her husband with this athletic young girl and he can not wait to watch their passionate lesbian action!

Cum and watch this fun and truly authentic threesome, it will leave you dreaming of your next Spanish holiday!
